import React from "react";
import logo from '../../utils/logoG.png'

 export const Footer = ()=>{
    const style = {
        backgroundImage:`url(${logo})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover'
    }
    return(
        <footer>
            created by Johan Cortes
            <a href='https://github.com/jako12287' target='_blank' ><div style={style}/></a>
            <a href='https://co.linkedin.com/' target='_blank'></a>
        </footer>
    )
}
